package main

import "math"

func updateMatrix(mat [][]int) [][]int {
	m := len(mat)
	n := len(mat[0])
	var q [][2]int
	for i := 0; i < m; i++ {
		for j := 0; j < n; j++ {
			if mat[i][j] == 0 {
				q = append(q, [2]int{i, j})
			} else {
				mat[i][j] = math.MaxInt64
			}
		}
	}

	for len(q) > 0 {
		c := q[0]
		q = q[1:]
		n := neighbors(c[0], c[1], n, m)

		for _, p := range n {
			if mat[p[0]][p[1]] > mat[c[0]][c[1]] {
				q = append(q, [2]int{p[0], p[1]})
				mat[p[0]][p[1]] = mat[c[0]][c[1]] + 1
			}
		}
	}

	return mat
}

func neighbors(row int, col int, m int, n int) [][]int {
	arr := [][]int{}
	if row+1 < n {
		arr = append(arr, []int{row + 1, col})
	}
	if row-1 >= 0 {
		arr = append(arr, []int{row - 1, col})
	}
	if col+1 < m {
		arr = append(arr, []int{row, col + 1})
	}
	if col-1 >= 0 {
		arr = append(arr, []int{row, col - 1})
	}
	return arr
}

